import './FoodItems.scss';
import { useDispatch, useSelector} from 'react-redux';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';

const FoodList=()=>{
  
const {data}=useSelector(store=>store.food)
const content =  <FoodItems  data={data} />;
  return (
    <div >
      {content}    
        <button   className="button button__main button__long">
            <div className="inner">load more</div>
        </button>
    </div>
  )

}

const FoodItems=({data})=>{
  const elements = data.map((item,index) => {
    // console.log(item.id)
    return(
      <FoodItem
        key={index}
        {...item}
      />
    )
      
  })
  return(
    <ul >
        {elements}
    </ul>
  )
}

const FoodItem=(props)=>{
  console.log(props)
  // const { name, thumbnail,focusOnItem,ourClass} = props;
  // let CharImg = "char__item__img" ;
  // if (thumbnail==="http://i.annihil.us/u/prod/marvel/i/mg/b/40/image_not_available.jpg") CharImg="char__item__no__img"
  
  return(
    <li   tabIndex={0}>
          <div >{props.recipe.label}</div>
          <img  src={props.recipe.images.REGULAR.url} alt="abyss"/>
          <p>Total Weight {props.recipe.totalWeight}</p>
    </li> 
    
  )
}
export default FoodList;
